import Product from "./Product"
import image1 from "../img/epices_viande.jpg"
import { productData } from "../data/productData"

export default function ProductGroup(){
  const productList = productData
  const img1 = image1
  return(
      <div className="container">
      <div className="text-center"><h1>Nos produits</h1></div>
      <div className="row">
        {productList.map(p => (
          <div className="col"><Product key={p.id} productName={p.productName} productDesc={p.productDesc} productImg={eval('img'+p.id)}/></div>
          )
          )
        }
      </div>
    </div>
  )
}
